import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

import "bootstrap/dist/css/bootstrap.min.css";

import App from "../pages/App";
import NavigationBar from "./medium/navbar"
import Home from "./pages/home";
import LogIn from "./pages/login";
import SignUp from "./pages/signup";
import ProductKacang from "./pages/productkacang";
import ProductTraditional from "./pages/producttraditional";
import ProductKeripik from "./pages/productkeripik";
import ProductPermen from "./pages/productpermen";

import * as serviceWorker from './serviceWorker';

const Root = () => (
  <Router>
   <NavigationBar/>
   <Switch>
      <Route component={App} exact path="/" />
      <Route component={LogIn} path="/login" />
      <Route component={SignUp} path="/signup" />
      <Route component={CheckOut} path="/checkout" />
   </Switch>
 </Router>
)

ReactDOM.render(<Root />, document.getElementById('root'));
serviceWorker.unregister();
